Komedie / Drama
97 minuten

goed

met Ashton Kutcher, Anne Heche en Margarita Levieva

Los Angeles. Nikki is een echte vrouwenverslinder. Hij geeft een hoop feestjes, waar hij altijd populair is bij de vrouwen. Alles 
loopt op rolletjes, totdat hij de bloedmooie Heather (Levieva) ontmoet. Zij speelt namelijk dezelfde spelletjes die hij speelt en 
zo lijken de rollen opeens omgedraaid.
